package demo.Test.IC;

public class Methods_Exp {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n = 3;
		System.out.println(multiple(n));
	}

	public static int multiple(int i) {
		int m;
		m = i * i;
		return m;
	}

	public static int multiple() {
		int m;
		m = 2 * 2;
		return m;
	}
}
